class Solution(object):
    def numberOfPowerfulInt(self, start, finish, limit, s):
        count = 0
        s_len = len(s)
        start_prefix = start // (10 ** s_len)
        end_prefix = finish // (10 ** s_len)

        if start_prefix == end_prefix:
            if start <= int(str(start_prefix) + s) <= finish:
                count += 1
        else:
            if start <= int(str(start_prefix) + s) <= finish:
                count += 1
            if start <= int(str(end_prefix) + s) <= finish:
                count += 1

            for prefix in range(start_prefix + 1, end_prefix):
                if all(int(digit) <= limit for digit in str(prefix)):
                    count += 1

            # Handle special case when s itself is a powerful integer
            if int(s) >= start and int(s) <= finish and all(int(digit) <= limit for digit in s):
                count += 1

        # Check for numbers with s as suffix and prefix digits <= limit within the direct range
        if len(s) == 1:
            for i in range(max(1, start_prefix), min(end_prefix, limit) + 1):
                num = int(str(i) + s)
                if start <= num <= finish:
                    count += 1

        return count
